  CONSTRAINT `pegawai_karir_v4_divisi_FK2` FOREIGN KEY (`divisi_id`) REFERENCES `divisi` (`divisi_id`) ON UPDATE CASCADE,
  CONSTRAINT `pegawai_karir_v4_divisi_bagian_FK2` FOREIGN KEY (`divisi_bagian_id`) REFERENCES `divisi_bagian` (`divisi_bagian_id`) ON UPDATE CASCADE,
  CONSTRAINT `pegawai_karir_v4_master_jabatan_FK2` FOREIGN KEY (`jabatan_id`) REFERENCES `master_jabatan` (`jabatan_id`) ON UPDATE CASCADE,
  CONSTRAINT `pegawai_karir_v4_master_pegawai_status_FK2` FOREIGN KEY (`status_pegawai_id`) REFERENCES `master_pegawai_status` (`status_pegawai_id`) ON UPDATE CASCADE,
  CONSTRAINT `pegawai_karir_v4_pegawai_FK2` FOREIGN KEY (`pegawai_id`) REFERENCES `pegawai` (`pegawai_id`) ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=345 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
